import React, { useState } from "react";
import axios from "axios";
import GenerateRecipeForm from "../components/GenerateRecipeForm";
import DisplayRecipe from "../components/DisplayRecipe";
import Navbar from "../components/Navbar";

const GenerateRecipe = () => {
  const [recipe, setRecipe] = useState(null); // State to store recipe data
  const [isRecipeSaved, setIsRecipeSaved] = useState(false);

  // Function to handle generation of recipe based on user input (prompt)
  const handleGenerate = async (prompt) => {
    try {
      const response = await axios.get(
        `http://localhost:5001/generate-recipe`,
        {
          params: { prompt: prompt }, // Pass prompt as query parameter
        }
      );
      setRecipe(response.data); // Set fetched/generated recipe data to state
    } catch (error) {
      console.error("Error generating recipe:", error);
    }
  };

  // Function to handle saving of recipe to MongoDB
  const handleSave = async () => {
    console.log("Recipe to be saved:", recipe); // Log the recipe object
    try {
      const response = await axios.post(
        "http://localhost:5001/save-recipe",
        recipe,
        {
          headers: {
            "Content-Type": "application/json",
          },
        }
      );
      alert("Recipe saved successfully!");
      setIsRecipeSaved(true); // Update state to indicate the recipe has been saved
    } catch (error) {
      console.error("Error saving recipe:", error);
    }
  };

  return (
    <div>
      <Navbar />
      <section className="px-20">
        <h1 className="text-xl font-bold mb-4">Generate Recipe</h1>
        <section>
          <div>
          <svg xmlns="http://www.w3.org/2000/svg" width="100" height="100" viewBox="0 0 36 36"><path fill="#99aab5" d="M30 32.5c0 1.933-5.373 3.5-12 3.5S6 34.433 6 32.5c0-1.932 5.372-3.5 12-3.5c6.627 0 12 1.567 12 3.5"/><path fill="#99aab5" d="M6 31.5h24v1H6z"/><path fill="#e6e7e8" d="M30 31.5c0 1.933-5.373 3.5-12 3.5S6 33.433 6 31.5S11.372 28 18 28c6.627 0 12 1.567 12 3.5"/><path fill="#5c913b" d="M29 31c0 1.656-4.926 3-11 3c-6.075 0-11-1.343-11-3s4.924-3 11-3c6.075 0 11 1.343 11 3"/><path fill="#5c913b" d="M7 8h22v23H7z"/><path fill="#a6d388" d="M29 23c0 1.932-4.926 3.5-11 3.5c-6.075 0-11-1.567-11-3.5s4.924-3.5 11-3.5c6.074 0 11 1.567 11 3.5"/><path fill="#a6d388" d="M7 10h22v13H7z"/><path fill="#5c913b" d="M29 14c0 1.932-4.926 3.5-11 3.5c-6.075 0-10.999-1.567-10.999-3.5S11.925 10.5 18 10.5c6.074 0 11 1.567 11 3.5"/><path fill="#5c913b" d="M7 4h22v10H7z"/><path fill="#99aab5" d="M30 4.5C30 6.433 24.627 8 18 8S6 6.433 6 4.5S11.373 1 18 1s12 1.567 12 3.5"/><path fill="#99aab5" d="M6 3.5h24v1H6z"/><path fill="#e6e7e8" d="M30 3.5C30 5.433 24.627 7 18 7S6 5.433 6 3.5S11.373 0 18 0s12 1.567 12 3.5"/><path fill="#ccd6dd" d="M28.25 3.5C28.25 4.881 23.662 6 18 6S7.75 4.881 7.75 3.5S12.338 1 18 1s10.25 1.119 10.25 2.5"/><path fill="#e6e7e8" d="M27.25 3.5c0 1.105-4.14 2-9.25 2s-9.25-.895-9.25-2s4.141-2 9.25-2c5.11 0 9.25.895 9.25 2"/><path fill="#ccd6dd" d="M24 3.5c0 .69-2.686 1.25-6 1.25s-6-.56-6-1.25s2.686-1.25 6-1.25s6 .56 6 1.25"/><ellipse cx="18" cy="3.5" fill="#e6e7e8" rx="4.75" ry=".75"/><path fill="#ffcc4d" d="M25 21c0 4.142-3.134 7.5-7 7.5s-7-3.358-7-7.5s3.134-7.5 7-7.5s7 3.358 7 7.5"/><path fill="#ffac33" d="M23 21c0 3.156-2.239 5.715-5 5.715s-5-2.56-5-5.715s2.238-5.714 5-5.714s5 2.558 5 5.714"/></svg>
          </div>
        <GenerateRecipeForm onGenerate={handleGenerate} />
        </section>

        {recipe && (
          <div>
            <DisplayRecipe recipe={recipe} />
            {!isRecipeSaved && (
              <button
                className="text-white bg-gray-800 hover:bg-gray-900 focus:outline-none focus:ring-4 focus:ring-gray-300 font-medium rounded-lg text-sm px-5 py-2.5 me-2 mb-2 dark:bg-gray-800 dark:hover:bg-gray-700 dark:focus:ring-gray-700 dark:border-gray-700"
                onClick={handleSave}
              >
                Save Recipe
              </button>
            )}
          </div>
        )}
      </section>
    </div>
  );
};

export default GenerateRecipe;
